import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { ChakraProvider, Box } from '@chakra-ui/react';
import Navbar from './components/Navbar';
import LandingPage from './components/LandingPage';
import About from './components/About';
import Program from './components/Program';
import Team from './components/Team';
import Sponsor from './components/PastSponsors';
import Upcoming from './components/Upcoming';
import GetInvolvedSection from './components/GetInvolved';
import Footer from './components/Footer';
import SubscriptionSection from './components/Email';
import PrivacyPolicy from './components/Privacy';
import theme from './theme'; // Ensure you have the theme file set up

const App = () => {
  return (
    <ChakraProvider theme={theme}>
      <Router>
        <Box minHeight="100vh" bg="white" overflowX="hidden">
          <Navbar />
          <Switch>
            <Route exact path="/">
              <LandingPage />
            </Route>
            <Route path="/about">
              <About />
            </Route>
            <Route path="/program">
              <Program />
            </Route>
            <Route path="/team">
              <Team />
            </Route>
            <Route path="/sponsor">
              <Sponsor />
            </Route>
            <Route path="/upcoming">
              <Upcoming />
            </Route>
            <Route path="/get-involved">
              <GetInvolvedSection />
            </Route>
            <Route path="/privacy-policy">
              <PrivacyPolicy />
            </Route>
            {/* Add more routes as needed */}
          </Switch>
          <SubscriptionSection />
          <Footer />
        </Box>
      </Router>
    </ChakraProvider>
  );
};

export default App;
